export class InputComponent implements OnInit {

  // input attributes
  @Input() Labelcontent:string = '';
  @Input() inputId: string = '';
  @Input() type: string = '';
  @Input() placeholder?: string = '';
  @Input() value: string =  '';
  @Input() icon:string = 'user';
  @Input() iconColor: string = '#C4E5FF'
  private _theme: string = 'light';
  private _labelPos: string = '';

  // getters
  get theme() {
    return this._theme
  }
  @Input() set theme(newTheme:string) {
    this._theme = newTheme;
  }
  get labelPos(){
    return this._labelPos;
  }

  // refs
  @ViewChild('inputField') inputField!: ElementRef<HTMLInputElement> 

  activateField(){

    if (this.value){
      this._labelPos = "labelFilled"
    } else {
      this._labelPos = ""
    }
  }


  ngOnInit(): void {
  }

}

